data.text:
@Mauriciomulder AGP tuvo un primer gobierno lleno de obtusidad, corrupción y torpeza pura.
El segundo gobierno que coincidió con la bonanza minera del cobre, se sumió en la corrupción y el saqueo en lugar de subsanar yerros sirviendo a la patria y sus votantes.
Una vergüenza el cobarde suicida!
